defineService({name:"Printer",onStart:async e=>{e.state.count=0,e.state.intervalId=setInterval(()=>{e.state.count+=1,Neo.log.info(`[Printer] Hello from JS! Count: ${e.state.count}`)},5e3),Neo.log.info("[Printer] Service started - will print every 5 seconds")},onStop:async e=>{e.state.intervalId&&clearInterval(e.state.intervalId),Neo.log.info(`[Printer] Service stopped after ${e.state.count} prints`)}});
